<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Contact Me</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            color: rgb(255, 255, 255);
        }

        /* body {
            background: #080808;
            color: #fff;
        } */

        .container {
            /* border: 2px solid black; */
            display: flex;
            flex-direction: row;
            flex-wrap: wrap;
            align-content: space-between;
            justify-content: center;
            align-items: center;
            gap: 50px;
            padding-top: 30px;
            padding-bottom: 30px;
            background-blend-mode: overlay;
            filter: blur(1);
        }

        .form {
            /* border: 5px solid; */
            box-shadow: inset;
            border-radius: 20px;
            padding: 30px 45px;
            display: flex;
            flex-direction: column;
            align-items: center;
            filter: blur(1);
            box-shadow: 0px 25px 120px 35px rgba(80,149,0,1);
        }

        form {
            width: 300px;
            margin: 0 auto;
            font-weight: bold;
            font-size: larger;
        }

        .map{
            border: 1px solid rgb(0, 90, 0);
            box-shadow: 0px 25px 120px 30px rgba(80,149,0,1);

        }

        label {
            display: block;
            margin-top: 20px;
        }

        input[type="text"],
        input[type="email"],
        input[type="tel"] {
            width: 100%;
            padding: 10px;
            margin-top: 5px;
            border-radius: 5px;
        }

        textarea {
            width: 100%;
            padding: 10px;
            margin-top: 5px;
            height: 100px;
        }

        input[type="submit"] {
            width: 80%;
            padding: 10px;
            margin-top: 20px;
            background-color: rgb(199, 12, 236);
            color: white;
            border-radius: 30px;
            cursor: pointer;
        }

        input :hover {
            background-color: aliceblue;
        }
